import React from "react";
import "./footer.css";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="footer-top">
          <FooterAboutus
            FooterHeading={"About Us"}
            footerPara={
              "Lorem ipsum is placeholder text commonly used to demonstrate the visual form of a document."
            }
            i1={"fa-brands fa-facebook-f"}
            i2={"fa-brands fa-instagram"}
            i3={"fa-brands fa-youtube"}
          />
          <CompanyServises
            class={"footersec"}
            FooterHeading={"Company"}
            li1={"Home"}
            li2={"About"}
            li3={"Contact Us"}
            li4={"Services"}
            li5={"Our Team"}
          />
          <CompanyServises
            class={"footersec finance"}
            FooterHeading={"Services"}
            li1={"Financial Management"}
            li2={"Financial Reporting"}
            li3={"Financial Companies"}
            li4={"Assurance & Advisory"}
            li5={"Finance Transformation Programme"}
          />
          <Newsletter
            class={"footersec"}
            FooterHeading={"Newsletter"}
            NewsSub={"Subscribe Our Newsletter"}
          />
        </div>
      </footer>
    </>
  );
};
export default Footer;

function FooterAboutus(props) {
  return (
    <>
      <div className="footersec finance">
        <h3>{props.FooterHeading}</h3>
        <div className="bar-red"></div>
        <div className="footer-para">
          <p>{props.footerPara}</p>
        </div>
        <div className="footer-icon-container">
          <div className="footer-icon">
            <i class={props.i1}></i>
          </div>
          <div className="footer-icon">
            <i class={props.i2}></i>
          </div>
          <div className="footer-icon">
            <i class={props.i3}></i>
          </div>
        </div>
      </div>
    </>
  );
}
function CompanyServises(props) {
  return (
    <>
      <div className={props.class}>
        <h3>{props.FooterHeading}</h3>
        <div className="bar-red"></div>
        <ul>
          <li>{props.li1}</li>
          <li>{props.li2}</li>
          <li>{props.li3}</li>
          <li>{props.li4}</li>
          <li>{props.li5}</li>
        </ul>
      </div>
    </>
  );
}
function Newsletter(props) {
  return (
    <>
      <div className={props.class}>
        <h3>{props.FooterHeading}</h3>
        <div className="bar-red"></div>
        <h4>{props.NewsSub}</h4>
        <div className="news-input">
          <input type="email" name="" id="" />
          <button></button>
        </div>
      </div>
    </>
  );
}
